import { Table } from 'antd'

const { useTableRowSelection } = Hooks

const Demo = () => {
  // \u53C2\u6570 rowKey \u662F\u5217\u8868\u5355\u4E2A\u6570\u636E\u4E2D\u53EF\u4EE5\u6807\u8BC6\u4E3A\u552F\u4E00\u503C\u7684\uFF0C\u4E00\u822C\u4E0E Table \u7684 rowKey \u4FDD\u6301\u4E00\u81F4
  // \u7B2C\u4E00\u4E2A\u6CDB\u578B RT\uFF0C\u975E\u5FC5\u586B\uFF0C\u5217\u8868\u5355\u4E2A\u6570\u636E\u7684\u7C7B\u578B\uFF0C\u58F0\u660E\u540E\u53C2\u6570\u6709\u63D0\u793A
  // \u7B2C\u4E8C\u4E2A\u6CDB\u578B RT\uFF0C\u975E\u5FC5\u586B\uFF0C\u552F\u4E00\u503C\u7684\u6570\u636E\u7C7B\u578B\uFF0C\u5982\u679C\u6CA1\u6709\u7279\u522B\u64CD\u4F5C\u53EF\u4EE5\u4E0D\u58F0\u660E
  const { rowSelection, onCleanSelected } = useTableRowSelection<
    {
      id: number
    },
    number
  >('id')

  const selectedRowKeyNum = rowSelection.selectedRowKeys.length

  return (
    <Layout.Content>
      <Card.Table
        alertExtra={
          selectedRowKeyNum ? (
            <SearchFormLayout.Space>
              <span>\u5DF2\u9009 {selectedRowKeyNum} \u9879\u76EE</span>
              <a onClick={onCleanSelected}>\u53D6\u6D88\u9009\u62E9</a>
            </SearchFormLayout.Space>
          ) : null
        }>
        <Table rowKey="id" rowSelection={rowSelection} />
      </Card.Table>
    </Layout.Content>
  )
}
